import React, { Component } from "react";
export default class Navbar extends Component {
  render() {
    return (
      <nav className="d-flex justify-content-between">
        <h1 className="mr-2 mt-2">ویرا وب آپادانا</h1>
        <div className="d-flex">
          <button className="btn btn-light">
            <i className="fas fa-user-astronaut mx-1" />
            <span className="mx-1">مشاوره رایگان</span>
          </button>
          <div className="d-flex flex-column numbers text-right">
            <div className="d-flex">
              <i className="fa-phone" />
              <strong>۰۲۱-۴۴۲۵۹۶۸۸</strong>
            </div>
            <strong>۰۲۱-۴۴۲۵۹۶۱۱</strong>
          </div>
        </div>
      </nav>
    );
  }
}
